{
    "preset": "psr12",
    "rules": {
        "group_import": true,
        "single_import_per_statement": false,
        "no_unused_imports": true,
        "array_indentation": true,
        "array_syntax": {
            "syntax": "short"
        },
        "braces"                      : {
            "allow_single_line_closure"                   : false,
            "position_after_anonymous_constructs"         : "same",
            "position_after_control_structures"           : "same",
            "position_after_functions_and_oop_constructs" : "next"
        },
        "binary_operator_spaces": {
            "default": "single_space",
            "operators": {
                "=": "align_single_space_minimal",
                "=>": "align_single_space_minimal"
            }
        },
        "blank_line_after_namespace": true,
        "blank_line_after_opening_tag": false,
        "class_attributes_separation": {
            "elements": {
                "property": "one",
                "method" : "one"
            }
        },
        "concat_space": {
            "spacing": "one"
        },
        "declare_equal_normalize": {
            "space": "single"
        },
        "elseif": false,
        "encoding": true,
        "indentation_type": true,
        "no_useless_else": false,
        "no_useless_return": true,
        "ordered_imports": true,
        "ternary_operator_spaces": true,
        "no_extra_blank_lines": true,
        "no_multiline_whitespace_around_double_arrow": true,
        "multiline_whitespace_before_semicolons": true,
        "no_singleline_whitespace_before_semicolons": true,
        "no_spaces_around_offset": true,
        "ternary_to_null_coalescing": true,
        "whitespace_after_comma_in_array": true,
        "trim_array_spaces": true,
        "trailing_comma_in_multiline": true,
        "unary_operator_spaces": true,
        "blank_line_before_statement": {
            "statements": [
                "break",
                "continue",
                "declare",
                "return",
                "throw",
                "try",
                "continue",
                "do",
                "exit",
                "for",
                "foreach",
                "if",
                "include",
                "include_once",
                "require",
                "require_once"
            ]
        }
    }
}

const colors = require('tailwindcss/colors')

module.exports = {
    content: ["./resources/**/*.{html,js}"],
    theme: {
        extend: {
            colors: {
                'pg-primary': colors.slate,
                'pg-secondary': colors.blue,
            }
        }
    }
}

const mix = require('laravel-mix')

mix.js('resources/js/index.js', 'powergrid.js')
    .css('resources/css/tailwind.css', 'tailwind.css')
    .css('resources/css/bootstrap.css', 'bootstrap5.css')
    .setPublicPath('dist')

if (mix.inProduction()) {
    mix.version()
}
